import "./animations.css";

export default function Skills() {
  const skills = [
    "Node.js",
    "PHP",
    "JavaScript",
    "HTML",
    "CSS",
    "Bootstrap",
    "GitHub"
  ];

  return (
    <section className="bg-light py-5 fade-in">
      <div className="container">
        <h2>Skills</h2>
        <div className="row">
          {skills.map(skill => (
            <div key={skill} className="col-md-3 mb-3">
              <div className="card text-center p-2 shadow-sm">
                {skill}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
